@boni_castellane Il "emendamento, passa!" è magia, non politica.
La realtà è lavoro, relazioni, intuizione e a volte un po' di fortuna. 
E' anche perseveranza, tenere una posizione. Non passa una volta? Magari passa quella dopo. Non c'è una formula.

